import FriendlyPic from "../images/friendlyPic.jpeg";

const FriendlyAd = () => {
  return (
    <div className="friendly-container">
      <div
        className="friendly-img"
        style={{
          backgroundImage: "url(" + FriendlyPic + ")",
          backgroundSize: "cover",
          backgroundPosition: "center",
        }}
      >
        <div className="tint"></div>
        <h3>Fast Service</h3>
        <h3>Fair Fees</h3>
        <h3>Family friendly enviornment</h3>
      </div>
    </div>
  );
};
export default FriendlyAd;
